import React from "react";
import './index.css';
import communitylogo from "./communitylogo.png";

function Communitylogin1() {
    return (
        <div className="community-login-container1" >
            <div className="community-app-logo">
                <img src={communitylogo} alt="communitylogo" height="124.53" width="150" />
            </div>
            {/* <div className="login-box"> <input type="text" placeholder="Login" /></div>
            <div className="sign-up-box"> <input type="text" placeholder="Sign Up" /></div> */}
            <div style={{ justifyContent: "center" }}>
                <button
                    className="login-box"
                    onClick={(e) => {

                        alert("Login");
                    }}
                >
                    Login
                </button>
            </div>
            <div style={{ justifyContent: "center" }}>
                <button
                    className="sign-up-box"
                    onClick={(e) => {

                        alert("Sign Up");
                    }}
                >
                    Sign Up
                </button>
            </div>

            {/* <div className="guest-mode">Continue as a guest</div> */}


        </div>

    );
}
export default Communitylogin1
